def is_perfect_square(n):
    # Returns True if n is a perfect square
    return int(n**0.5)**2 == n

def is_perfect_fourth_power(n):
    # Returns True if n is a perfect fourth power
    return int(n**0.25)**4 == n

def is_product_of_two_prime_numbers(n):
    # Returns True if n is the product of two prime numbers
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            j = n // i
            if j == 1 or j % 2 != 0:
                return False
    return True

